import React, { Component } from 'react';
// import { Button } from 'react-bootstrap';


import history from './history';

export default class Home extends Component(){
    render(){
        return(
            <div>
                <h1>Hi! Home page</h1>
                <button  onClick={() => history.push('/Flower-Match')}>Go to spring</button>
            </div>
        )
    }
}
